import logo from '../../logo.svg';
import './Navbar.css';

export default class Navbar extends Component {
    constructor() {
        super();
        this.state = {
        };
    }

    render() {
        return (
            <div className="navbar-wrap">
                <div className="navbar">
                    <button className="nav-button">Bodywork</button>
                    <button className="nav-button">Energetic Therapy</button>
                    <button className="nav-button">Scheduling</button>
                    <button className="nav-button">Office Location</button>
                    <button className="nav-button">Your Therapist</button>
                </div>
                <div></div>
            </div>
        );
    }
}
